import { useEffect, useState } from "react";
import start0 from "./images/start0.png";
import { useSelector } from "react-redux";

export default function HangmanLogic() {
  const player = useSelector((state) => state.player);
  const [board, setBoard] = useState([]);

  const handleGuess = () => {};

  const setupBoard = () => {
    return "abcdefghijklmnoprstuvwzxy".split("").map((letter) => (
      <button
        className="m-2 p-2 bg-white text-black rounded "
        key={letter}
        value={letter}
      >
        {letter}
      </button>
    ));
  };

  useEffect(() => {
    setBoard(setupBoard());
  }, []);

  return (
    <div className="bg-red-600 text-black h-screen">
      <div className="stats text-right mr-56 pt-10">
        <div>Username: {player}</div>
        <div>Score: 103</div>
        <div>Time</div>
        <div>Misstakes 0 of 6 </div>
      </div>
      <div className="w-1/5 pt--10 ml-56">
        <img src={start0} alt="hangmangame" />
      </div>
    </div>
  );
}

